import React from 'react'

const TableHead = () => {
  return (
    <div>
                  <li className="list-item" key={todo.id}>
              <input
                type="text"
                value={todo.title}
                className={`list ${todo.completed ? "complete" : "" }`}
                onChange={(e) => e.preventDefault()}
              />

              <input
                type="text"
                value={todo.owner}
                className={`list ${todo.completed ? "complete" : "" }`}
                onChange={(e) => e.preventDefault()}
                ></input>

              <input
                type="text"
                value={todo.location}
                className={`list ${todo.completed ? "complete" : "" }`}
                onChange={(e) => e.preventDefault()}
              ></input>
            </li>
    </div>
  )
}

export default TableHead
